    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Roanoke River NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Roanoke River NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, alternatives, a description of the affected environment,
    environmental consequences, and consultation with others. Key planning issues include:
    hydrology, fish and wildlife populations, habitats, public use, administration,
